import React, { useEffect, useState } from "react";
import Card from "react-bootstrap/Card";
import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
import { Link } from "react-router-dom";
import axios from "axios";
import doctor from "../Images/doctor.jpg";

const MyDoctors = () => {
  const [doctors, setDoctors] = useState([]);
  const [name, setName] = useState("");
  const [username, setUsername] = useState("");
  const [hospitalName, setHospitalName] = useState("");
  const [department, setDepartment] = useState("");
  const [designation, setDesignation] = useState("");
  const [area, setArea] = useState("");

  const [query, setQuery] = useState();

  const loadDoctors = async () => {
    const url = "http://localhost:8000/patients/doctor-list";

    const res = axios
      .get(url, { params: query })
      .then((response) => {
        
        setDoctors(response.data.doctors);
        console.log(response.data.doctors[0].consultency[0]);
       
      })
      .catch((error) => {
        console.log(error);
      });
   
  };

  const doDoctorSearch = () => {
    setQuery({
      department: department,
      designation: designation,
      name: name,
      area: area,
    });
  };

  useEffect(() => {
   
    loadDoctors();
  }, [query]);

  return (
    <>
     
    <div className="max-w-[1320px] mx-auto">
      <h1 className="text-3xl font-bold text-center mt-10">My Doctors</h1>
    </div>
    <div class="grid grid-cols-1 md:grid-cols-3 gap-8 mx-10">
    <div class="grid grid-cols-4 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4 mx-10 my-10 ">
  {doctors && doctors.length > 0 ? (
    doctors.map((doctor, index) => (
      <div key={index} class="bg-white shadow-md rounded-lg overflow-hidden">
        <img class="w-full h-50 object-cover object-center" src={doctor} alt="Card Image"/>
        <div class="p-4">
          <h2 class="font-bold text-xl mb-2">{doctor.name}</h2>
          <p class="text-gray-700">{doctor.department}</p>
          <p class="text-gray-700">{doctor.designation}</p>
          <p class="text-gray-700">Clinic: {doctor.consultency[0] ? doctor.consultency[0].clinic_name : 'Not available'}</p>
          <h5>Visiting Hour :</h5>
          {doctor.consultency[0] && doctor.consultency[0].days ? (
            <p class="text-gray-700">
              Days: {doctor.consultency[0].days.map(day => day.day).join(', ')}
            </p>
          ) : (
            <p class="text-gray-700">Days: Not available</p>
          )}
          <p class="text-gray-700">Start Time: {doctor.consultency[0] ? doctor.consultency[0].start_time : 'Not available'}</p>
          <p class="text-gray-700">End Time: {doctor.consultency[0] ? doctor.consultency[0].end_time : 'Not available'}</p>
          <p class="text-gray-700">Room: {doctor.consultency[0] ? doctor.consultency[0].room : 'Not available'}</p>
        </div>
      </div>
    ))
  ) : (
    <p>NO doctor available</p>
  )}
</div>

{/* Filter Search Grid */}
<div class="col-span-1 bg-white shadow-md rounded-lg p-4">
    <h2 class="text-xl font-bold mb-4">Filter Search</h2>
    <form>
      <div class="mb-4">
        <label class="block text-gray-700 text-sm font-bold mb-2" for="doctorName">Doctor Name</label>
        <input class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" id="doctorName" type="text" placeholder="Enter Doctor's Name" />
      </div>
      <div class="mb-4">
        <label class="block text-gray-700 text-sm font-bold mb-2" for="designation">Designation</label>
        <input class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" id="designation" type="text" placeholder="Enter Doctor's Designation" />
      </div>
      <div class="mb-4">
        <label class="block text-gray-700 text-sm font-bold mb-2" for="department">Department</label>
        <input class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" id="department" type="text" placeholder="Enter Doctor's Department" />
      </div>
      <div class="mb-4">
        <label class="block text-gray-700 text-sm font-bold mb-2" for="area">Area</label>
        <input class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" id="area" type="text" placeholder="Enter Doctor's Area" />
      </div>
      <button class="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline" type="button">Search</button>
    </form>
  </div>
    </div>
   

   

  
  
    </>
    
  )
}

export default MyDoctors
